import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { UserContextProvider } from "./context/userContext";
import { Route } from 'react-router-dom';


ReactDOM.render(
  <React.StrictMode>
    <UserContextProvider>
      <Route></Route>
      <App />
    </UserContextProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
